def get_features(m, field_prefix, server_list=None, append_list=False):
    res = []
    _map = {
        '{}_body_sha256'.format(field_prefix): body_shas,
        '{}_status_line'.format(field_prefix): status_lines,
        '{}_status_code'.format(field_prefix): status_codes,
        '{}_title'.format(field_prefix): titles
    }
    res += map_of_enumerated_fields(machine=m, _map=_map)

    if server_list is not None:
        if append_list:
            server_list = list(set(web_server_list + server_list))
    else:
        server_list = web_server_list

    server = get_field(m, '{}_headers_server'.format(field_prefix), t='str')
    add_str = ' '.join([server])
    res += common_models(m, field_prefix, server_list, add_str)

    return res


def extract(machine, args):
    res = []
    protocol = 'http'
    ports = [p for c in ports_and_protocols
             if c[0] == protocol
             for p in c[1]]
    for port in sorted(ports, reverse=True):
        field_prefix = 'p{}_{}_get'.format(port, protocol)
        res += get_features(machine, field_prefix)
    return res


